import React from 'react';
import Card from './Card';

function CardList({ pets, images, onPetSelection }) {
	const cards = [];
	const defaultPhotos = [];

	console.log(onPetSelection);
	images.map((img, i) => {
		if (images[i].defaultPic) {
			defaultPhotos.push(images[i]);
		}
	});

	defaultPhotos.map((photo, i) => {
		pets.map((pet, j) => {
			if(defaultPhotos[i].pets_id === pets[j].id) {
				cards.push(<Card onPetSelection={onPetSelection} key={pets[j].id} pk={pets[j].id} img={'http://localhost:4412/api/file/' + defaultPhotos[i].url} name={pets[j].name} description={pets[j].description}/>);
			}
		});
	});


		return(
			<div>{cards}</div>
		)

}

export default CardList;
